@gemlouisetaylor Hello! If the number given is not available, please visit our baggage department on the airport for easier handling or call the airport's general number for transfer to our baggage staff.

Kind regards,
Jenny

@Buchlingreport Hello! We are truly sorry for the inconvenience! For assist with your lost luggage, please contact our baggage department in Berlin on number +49 30 410 137 18 or visit the airport for easier handling.

Kind regards,
Jenny

@MxHedroom Hello! Sure! If you purchase a GO light ticket for example, with no included checked in or hand luggage, a small handbag/laptop is still allowed to be brought with. The maximum measurements for that one is 40 cm x 30 cm x 15 cm.

Kind regards,
Jenny

@microalicia Hello! We are very sorry for the inconvenience! When you open our live chat, there is an option that says "chat with customer service" Where you can reach us through. Then you will be placed in queue to our agents.

Kind regards,
Jenny

@KWKentUK Hello! We are truly sorry for the inconvenience! For further assist, please contact our customer service on messenger, live chat or phone. Our contact information can be found here: https://t.co/b3QIqPk7bj

Kind regards,
Jenny

@KimGron Hej! Ja tyvärr har vi endast flyg från Arlanda till Åbo 30e och 31a oktober och endast en retur den 31a oktober.

Med vänliga hälsningar,
Jenny

@KierseyDaniel Hello! For us to be able to help you, please contact us on messenger, livechat or phone. Our contact information can be found here: https://t.co/b3QIqPk7bj

Kind regards,
Jenny

@jaxelcool Hello! We are very sorry for the inconvenience! For assist when at the airport, please visit one of our ticket desks onsite or the responsible ticket desk for more information regarding your flight departure.

Kind regards,
Jenny

@IWouldTweet4U Hello! If we need to cancel a flight which will disrupt your trip, I recommend that you contact our customer service as soon as it happens, so we can look at other possible alternatives for you.

Kind regards,
Jenny

@gemlouisetaylor Hello! We are very sorry for the inconvenience! For assist, please contact our baggage department in London on phone number +44 344 3754250 or visit the airport for easier handling.

Kind regards,
Jenny

@drybrarian Hello! We are truly sorry for the inconvenience! For assist with your delayed luggage, please contact our baggage department in Pisa on phone number +39 050 849400.

Kind regards,
Jenny

@derick_m Hello! Unfortunatly we do not have any email to our customer service. You can reach us on messenger, live chat and phone. Our contact information can be found here: https://t.co/b3QIqPk7bj

Kind regards,
Jenny

@crypto_chic88 Hello! For assist with other rebooking alternatives, please contact the travel agency you booked the ticket through.

Kind regards,
Jenny

@bdubdb Hello! We are truly sorry for the inconvenience! For further assist with your lost luggage, please contact our customer service so we can help you. Our contact information can be found here: https://t.co/b3QIqPk7bj

Kind regards,
Jenny

@Barboron Hello! Unfortunatly, a powerbank with more than 160 Wh is not accepted on our flights. In this case we recommend that you send it by post or check if it can be ordered and sent through cargo. Their contact information can be found here: https://t.co/T0FqHI0P85

Warm regards
Jenny

@babarhassanshah Hello! We are very sorry for the inconvenience! You can report your lost bag here: https://t.co/7iWu2adlLd or by calling our baggage department in Amsterdam on number +31 20 795 27 00.

Warm regards,
Jenny

@a_hawker100 Hello! We are truly sorry for the inconvenience! For assist with your lost luggage, please contact our baggage department in London on number +44 344 3754250.

Warm regards,
Jenny

@Addeh_ Hello! Unfortunatly we are not able to assist you with this case on social media. Please contact our customer service so we can help you! Contact information can be found here: https://t.co/b3QIqPk7bj

Warm regards,
Jenny

@felipebesa Hi!
When the Airport change the gates, this information will be shown from the screens at the Airport. This information is therefore nothing we can send out as a message to you.

Kind regards, Angelica

@LarpTweets Hi!
We do unfortunately not have any further information regarding the delivery of your baggage. We recommend you to try contacting them once again to look more into this.

Best regards, Angelica

@robmakesthings Hi!
I am sorry to hear about your missed flight due to a delay. You can request a refund / compensation of this through this link: https://t.co/oKlCwpaMq8

Best regards, Angelica

@GlazSerup Hej!
Vi kan se att det fortsatt finns Ungdomsbiljetter kvar för ert önskade flyg. Dessa biljetter är populära och därför blir de slutsålda rätt snabbt, vilket resulterar till att enbart vuxenbiljetter kvarstår.

Bästa hälsningar, Angelica

@AlexW1864 Hi!
Once you have reported your bag missing, the tracing will immediately start. You are able to follow the tracing by typing in your file reference and your name here: https://t.co/2zwsPbiovs

Best regards, Angelica

@RozMurphy Hi!
We recommend you to report your bag missing through this link: https://t.co/ojhL9dIf2x and you will then be able to trace your bag further by the PIR number you will be given.

Best regards, Angelica

@KWKentUK Hi!
We recommend you to report your bag missing through this link: https://t.co/ojhL9dIf2x and you will then be able to trace your bag further by the PIR number you will be given.

Best regards, Angelica

@jomargwhite Hello!
I am sorry to hear about your daughters missing baggage. I recommend you to report the bags missing / delayed through this link: https://t.co/ojhL9dIf2x and will then be able to trace them further.

Best regards, Angelica

@bferguson2202 Hello!
I am sorry to hear the trouble reaching us regarding your baggage. I recommend you to report your bag lost / delayed through this link: https://t.co/ojhL9dIf2x and you will then be able to trace it further.

Best regards, Angelica

@alison98753590 Hello! 
I am sorry to hear about your lost baggage. I recommend you to report your bag missing / delayed through this link: https://t.co/ojhL9dIf2x and you will then be able to trace it further.

Kind regards, Angelica

@stedman_julia Hello!
I am sorry to hear about your lost baggage. You can report your bag delayed through this link: https://t.co/ojhL9dIf2x and will then be able to trace it.

Kind regards, Angelica

@MarieHjeltnes Hi, I´m sorry you had to wait that long for an answer. Sometimes we do have long queues on the phone. You can contact us by chat as well, in most cases we can help through the chat: https://t.co/b3QIqPk7bj
Best regards,
Stina

@jchannon Hi, you cannot add this on a smart ticket, only for flights to/from the US, Canada and Asia you have one more carry on bag. Otherwise you have one carry on bag and one underseat bag (Maximum size: 40 cm x 30 cm x 15 cm (length x width x depth))
Best regards,
Stina

@NiallMc00 Hi, contact us by chat or phone for assistance with registering the bike: https://t.co/b3QIqPk7bj and they can look if special dimensions apply and register it correctly.
Best regards,
Stina

@w_k_amat Hi, here you can find our contact information to phone or chat for help with assisting you: https://t.co/b3QIqPk7bj
Best regards,
Stina

@skaiwoka Hi, yes ofcourse :) you can contact Europ Assistance here: https://t.co/T8CzK72K9Y
Best regards,
Stina

@magnuskjoeller Hej, kontakta baggage service för information gällande ditt bagage: https://t.co/xHUSCD2Zj7
Vänliga hälsningar,
Stina

@sigurdimsen Hej, du kan alltid kontakta oss via telefon eller chatt så att vi kan titta på din bokning och möjliga ombokningsalternativ: https://t.co/cIkJt9kPnF
Vänliga hälsningar,
Stina

@w_k_amat Hi, you can claim missing points here: https://t.co/37eWaybR84 , if you have issues with the registration please contact us by chat or phone.
Best regards,
Stina

@skaiwoka Hi, unfortunately we only have travel insurance through Europe Assistance available in Scandinavian countries. 
Best regards,
Stina

@sigurdimsen Hej, du kan kontakta oss via chatt eller telefon för att titta på ombokning till ett snabbare alternativ: https://t.co/cIkJt9kPnF
Vänliga hälsningar,
Stina

@ERMomof3boys Hi, I´m sorry to hear about your experience. You can contact baggage service for help: https://t.co/ZV9bTO3uo2 and trace you bag here: https://t.co/2zwsPbhQFU
Best regards,
Stina

@ERMomof3boys Hi, I´m sorry to hear about your experience. You need to contact baggage service for help. Numbers can be found here: https://t.co/ZV9bTO3uo2 you can also trace your bag here: https://t.co/2zwsPbhQFU
Best regards,
Stina

@j_beckers Hi, you can always contact us by phone or chat to look at rebooking options. You can also apply for compensation here: https://t.co/oKlCwpaMq8
Best regards,
Stina

@jchannon Hi, if you are flying with Sas you always have a carry on bag on Go smart tickets, if you are flying with another airline please contact the airline for information regarding allowance. 
Best regards,
Stina

@d_litso Hi, please contact baggage service, numbers can be found here: https://t.co/ZV9bTO3uo2
Best regards,
Stina

@ThomasBinelli Hi, you can trace your bag here: https://t.co/2zwsPbhQFU and contact baggage service for more information regarding your luggage, numbers can be found here: https://t.co/ZV9bTO3uo2
Best regards,
Stina

@DilrazSidhu Hi, please contact baggage service for help with locating your luggage: https://t.co/ZV9bTO3uo2
Best regards,
Stina

@MarcFerre25 Hi, If you are having issues with online payment you are welcome to contact us by phone and we will assist you: https://t.co/b3QIqPk7bj
Best regards,
Stina

@AnabelTeixeira Hi, you can contact baggage service for help with locating your luggage: https://t.co/ZV9bTO3uo2
Best regards,
Stina

@gjandwani Hi, I´m really sorry to hear about your experience. You can apply for compensation here: https://t.co/oKlCwpaMq8
Best regards,
Stina

@skaiwoka Hi, we have travel insurance through Europe Assistance available in Denmark, Norway and Sweden.

Best regards,
Stina

@blackapinay In this case, please try with a different unit and web browser. Clear also the browser from cache and cookies. Otherwise, we recommend that you contact our customer service so we can assist you with this. Our contact can be found here: https://t.co/b3QIqPk7bj

Warm regards,
Jenny

@d_litso Hello! We are very sorry about your damaged bag! For more information on how you report your damaged bag, please read the information on our website here: https://t.co/KQdOdrH9TM under "damaged baggage".

Warm regards,
Jenny

@adrafq Hello! We are truly sorry for the inconvenience! Unfortunatly our customer care has a current handling time of at least 6-8 weeks of these cases. If no reply has reached you after 8 weeks, please contact our customer service so we can escalate your case.

Warm regards,
Jenny

@susiel51 If the numbers are not working for you, please contact the airport's general number so that they can transfer you to the baggage staff. You can also visit our baggage staff on the airport so that they can help you easier.

Warm regards,
Jenny

@abesh Hello! We are very sorry for the inconvenience! Unfortunatly, lounge can not be added by us manually. It must be prepurchased, and then after the trip is made, you can apply for a compensation through our feedback form here: https://t.co/xMt9zSrqJc

Warm regards,
Jenny

@8Ieia Hello! We are very sorry for the inconvenience! For further assist with your booking, please contact us through messenger, live chat or by phone. Our contact information can be found here: https://t.co/b3QIqPk7bj

Warm regards,
Jenny

@alisoncrawford5 Hello! If the form does not accept the compensation card ID, please use this link instead: https://t.co/xMt9zSrqJc and then state the card ID in the free text. You might also need to unbox the "yes-this claim is connected to a flight" box.

Warm regards,
Jenny

@bdubdb Hello! We are very sorry for the inconvenience! You can also contact us by messenger and live chat. Our contact information can be found here: https://t.co/b3QIqPk7bj

Warm regards,
Jenny
